import {makeStyles} from '@material-ui/core/styles'

export const useStyles = makeStyles((theme) => ({
    root: {
        '& div.tabs div.MuiTab-root': {
            width: '50%'
        },
        '& div.ads-wrapper': {
            '& h6.card-title': {
                backgroundColor: theme.palette.primary.adBgColor
            }
        },
        '& div.lots-wrapper': {
            '& h6.card-title': {
                backgroundColor: theme.palette.primary.lotBgColor
            }
        }
    }
}))
